import React, { Component } from 'react';
import Logo from '../logo/Logo'
import './HomePage.css'




class HomePage extends Component {

	constructor(props){
		super(props)
		this.state = {
				turns: this.props.turns,
		}
	}


    render()
    {
    	const turns = this.state.turns;
    		return(
    	<div className = 'container'>
    		   <div className = 'nav'>
    		      <div className = 'content'>
    		   </div>
    		   <div className = 'logo'>
    		      <Logo onRouteChange = {this.props.onRouteChange} />
    		   </div>
		       </div>
		<div className = 'home'>

				<div className = 'coments'>

				</div>		
				<div className = 'turns'>

		         { turns.map(turn =><li className = 'turn' key = {turn.id}>{turn.value}<button className="btn-1">green</button><button className="btn-2">green</button></li>)}

				</div>
	    </div>
     </div>


		);
    }




}

export default HomePage;
